//@use "../utils/variables" as *;
@import '../set_variables.scss';
header{
display: flex;
justify-content: space-between;
    .navigation{
        display: flex;
        justify-content: space-between;
        align-items: center;
        font-size: 24px;
        padding: 0 2rem;
        ul{
            display: flex;
            align-items: center;   
            a, li{
                color: $primary-color;
                padding: 10px;
                text-decoration: none;
                list-style: none;
                display: flex;
                flex-direction: row;
                :hover{
                text-decoration: underline; 
                }
            }
        }
    }
}
